import{_ as t,c as e,o as d,a7 as a}from"./chunks/framework.DkJ47SOg.js";const m=JSON.parse('{"title":"Models reference","description":"","frontmatter":{},"headers":[],"relativePath":"contribute/extension-development/reference/model-reference.md","filePath":"contribute/extension-development/reference/model-reference.md","lastUpdated":1709072026000}'),r={name:"contribute/extension-development/reference/model-reference.md"},o=a('<h1 id="models-reference" tabindex="-1">Models reference <a class="header-anchor" href="#models-reference" aria-label="Permalink to &quot;Models reference&quot;">​</a></h1><h2 id="function-wrappers" tabindex="-1">Function Wrappers <a class="header-anchor" href="#function-wrappers" aria-label="Permalink to &quot;Function Wrappers&quot;">​</a></h2><p>Most of the specialized object types have a corresponding wrapper functions. While developing a source, these wrappers seem to be nonfunctional. However, these wrappers are crucial, as they are the bridge between the JavaScript layer that the source runs on, and the Swift layer that the app runs on. The wrappers convert the Javascript object into a Swift object that the app can use.</p><div class="danger custom-block"><p class="custom-block-title">Warning</p><p>Not wrapping a created object with a wrapper function <strong>will cause the app to crash</strong> once the app gets the object. There will also be no way to find out which object was the cause of the crash, and the unit tests will not easily reveal the missing wrapper, as the conversion is only done within the app. The crashing behavior may be fixed in a later version of the app, where the source will just fail instead of bringing the app down along with it.</p></div><div class="tip custom-block"><p class="custom-block-title">Tip</p><p>Every time an object is created using braces (<code>{}</code>), it should always be wrapped.</p></div><h3 id="list-of-wrapper-functions" tabindex="-1">List of Wrapper Functions <a class="header-anchor" href="#list-of-wrapper-functions" aria-label="Permalink to &quot;List of Wrapper Functions&quot;">​</a></h3><ul><li><code>createChapter</code> for <a href="#chapter">Chapter</a> objects.</li><li><code>createChapterDetails</code> for <a href="#chapterdetails">ChapterDetails</a> objects.</li><li><code>createIconText</code> for <a href="#icontext">IconText</a> objects.</li><li><code>createManga</code> for <a href="#manga">Manga</a> objects.</li><li><code>createMangaTile</code> for <a href="#mangatile">MangaTile</a> objects.</li><li><code>createPagedResults</code> for <a href="#pagedresults">PagedResults</a> objects.</li><li><code>createSearchRequest</code> for <a href="#searchrequest">SearchRequest</a> objects.</li><li><code>createTag</code> for <a href="#tag">Tag</a> objects.</li><li><code>createTagSection</code> for <a href="#tagsection">TagSection</a> objects.</li></ul><h2 id="chapter" tabindex="-1">Chapter <a class="header-anchor" href="#chapter" aria-label="Permalink to &quot;Chapter&quot;">​</a></h2><p>The Chapter object contains most metadata about a chapter. Different chapters are differentiated by the Chapter ID. Changing the chapter ID will cause a different chapter entry to show up, even if another chapter has the same chapter number.</p><h3 id="required-fields" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields" aria-label="Permalink to &quot;Required Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>id</code></td><td>String</td><td>A given identifier of this chapter. This may be unique to the source. For example, one source may use <code>Chapter-1</code> in its URLs to identify this chapter, whereas other sources may use some numeric identifier, such as <code>123456</code>.</td></tr><tr><td><code>mangaId</code></td><td>String</td><td>The given identifier of the Manga that owns this chapter. This should match the id of the manga that the chapter is for.</td></tr><tr><td><code>chapNum</code></td><td>Number</td><td>The number of the chapter, which is used for sorting the chapter list. The number may be a decimal. Multiple chapters with the same number will be sorted based on their volume number or the group that created the chapter, if it exists. Otherwise, the chapters will be sorted on the chapter ID.</td></tr><tr><td><code>langCode</code></td><td><a href="#languagecode">LanguageCode</a></td><td>The language code which this chapter is associated with. This is used along with the <code>Content settings</code> option to filter the chapter list so only chapters for the languages specified by the user are shown.</td></tr></tbody></table><h3 id="optional-fields" tabindex="-1">Optional Fields <a class="header-anchor" href="#optional-fields" aria-label="Permalink to &quot;Optional Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>name</code></td><td>String</td><td>The title of the chapter.</td></tr><tr><td><code>volume</code></td><td>Number</td><td>The volume that the chapter belongs to. It is recommended to leave the volume number out if every chapter does not have a corresponding volume number, as the volume number interferes with sorting.</td></tr><tr><td><code>group</code></td><td>String</td><td>The group that posted the chapter.</td></tr><tr><td><code>time</code></td><td><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Date" target="_blank" rel="noreferrer">Date</a> object</td><td>The date that the chapter is published. If omitted, the chapter will have a creation of the time when the chapter list was loaded.</td></tr></tbody></table><h2 id="chapterdetails" tabindex="-1">ChapterDetails <a class="header-anchor" href="#chapterdetails" aria-label="Permalink to &quot;ChapterDetails&quot;">​</a></h2><p>The ChapterDetails object contains a small amount of metadata about the chapter and contains the list of pages.</p><h3 id="required-fields-1" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields-1" aria-label="Permalink to &quot;Required Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>id</code></td><td>String</td><td>The chapter ID of the chapter that the object respresents.</td></tr><tr><td><code>mangaId</code></td><td>String</td><td>The given identifier of the Manga that owns this chapter. This should match the id of the manga that the chapter is for.</td></tr><tr><td><code>pages</code></td><td>String Array</td><td>The list of pages in the chapter. The pages are ordered by the index of the array, where the 0th index is the first page, and so on. Each item should be a link to the image file that represents the page.</td></tr><tr><td><code>longStrip</code></td><td>Boolean</td><td>Indicates whether or not the chapter should be rendered in <strong>Long Strip Mode</strong>. A long strip is a webtoon or any other form of manga that uses very tall but narrow images.</td></tr></tbody></table><h2 id="icontext" tabindex="-1">IconText <a class="header-anchor" href="#icontext" aria-label="Permalink to &quot;IconText&quot;">​</a></h2><p>An icon text represents a line of text and an optional icon.</p><h3 id="required-fields-2" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields-2" aria-label="Permalink to &quot;Required Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>text</code></td><td>String</td><td>The text that the object represents.</td></tr></tbody></table><h3 id="optional-fields-1" tabindex="-1">Optional Fields <a class="header-anchor" href="#optional-fields-1" aria-label="Permalink to &quot;Optional Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>icon</code></td><td>String</td><td>THe icon that the object represents.</td></tr></tbody></table><h2 id="languagecode" tabindex="-1">LanguageCode <a class="header-anchor" href="#languagecode" aria-label="Permalink to &quot;LanguageCode&quot;">​</a></h2><p>A string enum defining full language names, and the corresponding language code.</p><div class="warning custom-block"><p class="custom-block-title">Warning</p><p>Some full language names have typos. These may be fixed in a future version.</p></div><h3 id="values" tabindex="-1">Values <a class="header-anchor" href="#values" aria-label="Permalink to &quot;Values&quot;">​</a></h3><table><thead><tr><th>Language Name</th><th>Language Code</th></tr></thead><tbody><tr><td><code>BENGALI</code></td><td><code>bd</code></td></tr><tr><td><code>BRAZILIAN</code></td><td><code>br</code></td></tr><tr><td><code>BULGARIAN</code></td><td><code>bg</code></td></tr><tr><td><code>CHINEESE</code></td><td><code>cn</code></td></tr><tr><td><code>CHINEESE_HONGKONG</code></td><td><code>hk</code></td></tr><tr><td><code>CZECH</code></td><td><code>cz</code></td></tr><tr><td><code>DANISH</code></td><td><code>dk</code></td></tr><tr><td><code>DUTCH</code></td><td><code>nl</code></td></tr><tr><td><code>ENGLISH</code></td><td><code>gb</code></td></tr><tr><td><code>FINNISH</code></td><td><code>fi</code></td></tr><tr><td><code>FRENCH</code></td><td><code>fr</code></td></tr><tr><td><code>GERMAN</code></td><td><code>de</code></td></tr><tr><td><code>GREEK</code></td><td><code>gr</code></td></tr><tr><td><code>HUNGARIAN</code></td><td><code>hu</code></td></tr><tr><td><code>INDIAN</code></td><td><code>in</code></td></tr><tr><td><code>INDONESIAN</code></td><td><code>id</code></td></tr><tr><td><code>IRAN</code></td><td><code>ir</code></td></tr><tr><td><code>ISRELI</code></td><td><code>il</code></td></tr><tr><td><code>ITALIAN</code></td><td><code>it</code></td></tr><tr><td><code>JAPANESE</code></td><td><code>jp</code></td></tr><tr><td><code>KOREAN</code></td><td><code>kr</code></td></tr><tr><td><code>LITHUANIAN</code></td><td><code>lt</code></td></tr><tr><td><code>MALAY</code></td><td><code>my</code></td></tr><tr><td><code>MEXIAN</code></td><td><code>mx</code></td></tr><tr><td><code>MONGOLIAN</code></td><td><code>mn</code></td></tr><tr><td><code>NORWEGIAN</code></td><td><code>no</code></td></tr><tr><td><code>PHILIPPINE</code></td><td><code>ph</code></td></tr><tr><td><code>POLISH</code></td><td><code>pl</code></td></tr><tr><td><code>PORTUGUESE</code></td><td><code>pt</code></td></tr><tr><td><code>ROMANIAN</code></td><td><code>ro</code></td></tr><tr><td><code>RUSSIAN</code></td><td><code>ru</code></td></tr><tr><td><code>SAMI</code></td><td><code>si</code></td></tr><tr><td><code>SANSKRIT</code></td><td><code>sa</code></td></tr><tr><td><code>SPANISH</code></td><td><code>es</code></td></tr><tr><td><code>THAI</code></td><td><code>th</code></td></tr><tr><td><code>TURKISH</code></td><td><code>tr</code></td></tr><tr><td><code>UKRAINIAN</code></td><td><code>ua</code></td></tr><tr><td><code>UNKNOWN</code></td><td><code>_unknown</code></td></tr><tr><td><code>VIETNAMESE</code></td><td><code>vn</code></td></tr><tr><td><code>WELSH</code></td><td><code>gb</code></td></tr></tbody></table><h2 id="manga" tabindex="-1">Manga <a class="header-anchor" href="#manga" aria-label="Permalink to &quot;Manga&quot;">​</a></h2><p>The Manga object contains most metadata about a manga. Different manga objects are differentiated by the Manga ID, and changing the Manga ID will return a different manga.</p><h3 id="required-fields-3" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields-3" aria-label="Permalink to &quot;Required Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>id</code></td><td>String</td><td>The given identifier of this Manga. This may be unique to the source which uses it. For example, one source may use the value &#39;1234&#39; to identify a manga, whereas another one may use the value &#39;One-Piece&#39; to identify</td></tr><tr><td><code>image</code></td><td>String</td><td>A URL pointing to a thumbnail which can be displayed to present the manga.</td></tr><tr><td><code>rating</code></td><td>Number</td><td>The rating which users have given this manga. Use <code>0</code> if the manga is unrated or the source has no rating system in place.</td></tr><tr><td><code>status</code></td><td><a href="#mangastatus">MangaStatus</a></td><td>The status of the manga, indicating if the manga is ongoing or completed.</td></tr><tr><td><code>titles</code></td><td>String Array</td><td>An array of titles which this Manga is called. The first title is the manga&#39;s official title, while extra entries are treated as alternate titles for the manga.</td></tr></tbody></table><h3 id="optional-fields-2" tabindex="-1">Optional Fields <a class="header-anchor" href="#optional-fields-2" aria-label="Permalink to &quot;Optional Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>langFlag</code></td><td>String</td><td>A language code for the Manga, if one is available. Examples: <code>en</code> is English, <code>jp</code> is Japanese, etc.</td></tr><tr><td><code>langName</code></td><td>String</td><td>The full name of the manga&#39;s language. <code>English</code>, <code>Japanese</code>, etc.</td></tr><tr><td><code>artist</code></td><td>String</td><td>The name of the manga&#39;s artist. Multiple artists should be concatenated into a String with a delimiter such as a comma separating each artist.</td></tr><tr><td><code>author</code></td><td>String</td><td>The name of the manga&#39;s author. Multiple authors should be concatenated into a String with a delimiter such as a comma separating each author.</td></tr><tr><td><code>avgRating</code></td><td>Number</td><td>The average rating of the manga. May be the same value as the <code>rating</code> field.</td></tr><tr><td><code>covers</code></td><td>String Array</td><td>Additional covers for the manga. Each entry is a URL pointing to the cover image.</td></tr><tr><td><code>desc</code></td><td>String</td><td>A description of this manga.</td></tr><tr><td><code>follows</code></td><td>Number</td><td>The number of followers of the manga if the source supports following mangas and displays follower counts.</td></tr><tr><td><code>tags</code></td><td><a href="#tagsection">TagSection</a> Array</td><td>An array containing the various tag sections. Only the first entry is actually displayed in the app.</td></tr><tr><td><code>users</code></td><td>Number</td><td>The number of users subscribed to the manga. May be the same value as the <code>follows</code> field.</td></tr><tr><td><code>views</code></td><td>Number</td><td>The number of views this manga has had.</td></tr><tr><td><code>hentai</code></td><td>Boolean</td><td>Whether or not this manga is a hentai. If it is set to true, the manga will not be visible to the user unless the user enables mature manga.</td></tr><tr><td><code>relatedIds</code></td><td>String Array</td><td>The IDs of related manga.</td></tr><tr><td><code>lastUpdate</code></td><td>String</td><td>A string showing when the manga was last updated. It might either be an absolute date (<code>March 1, 2021</code>) or a relative date (<code>2 days ago</code>).</td></tr></tbody></table><h2 id="mangastatus" tabindex="-1">MangaStatus <a class="header-anchor" href="#mangastatus" aria-label="Permalink to &quot;MangaStatus&quot;">​</a></h2><p>An integer enum representing the various statuses a manga can have.</p><h3 id="values-1" tabindex="-1">Values <a class="header-anchor" href="#values-1" aria-label="Permalink to &quot;Values&quot;">​</a></h3><table><thead><tr><th>Name</th><th style="text-align:center;">Value</th><th>Description</th></tr></thead><tbody><tr><td><code>Completed</code></td><td style="text-align:center;">0</td><td>A manga that has officially completed production. Does not mean that the current chapter list contains all chapters that the manga will ever have, as sources can add special pages posted on social media or scanlations for chapters in languages other than the official release language.</td></tr><tr><td><code>Ongoing</code></td><td style="text-align:center;">1</td><td>A manga that is still releasing chapters.</td></tr></tbody></table><h2 id="mangatile" tabindex="-1">MangaTile <a class="header-anchor" href="#mangatile" aria-label="Permalink to &quot;MangaTile&quot;">​</a></h2><p>A tile representing a manga. This is a more barebones version of <a href="#manga">the Manga object</a>, intended for things like homepages and searches which will not return most manga metadata.</p><h3 id="required-fields-4" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields-4" aria-label="Permalink to &quot;Required Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>id</code></td><td>String</td><td>The given identifier of this Manga. This may be unique to the source which uses it. For example, one source may use the value &#39;1234&#39; to identify a manga, whereas another one may use the value &#39;One-Piece&#39; to identify</td></tr><tr><td><code>image</code></td><td>String</td><td>A URL pointing to a thumbnail which can be displayed to present the manga.</td></tr><tr><td><code>title</code></td><td><a href="#icontext">IconText</a></td><td>An Icon Text object representing the title of the manga.</td></tr></tbody></table><h3 id="optional-fields-3" tabindex="-1">Optional Fields <a class="header-anchor" href="#optional-fields-3" aria-label="Permalink to &quot;Optional Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>subtitleText</code></td><td><a href="#icontext">IconText</a></td><td>An Icon Text object representing the subtitle of the manga.</td></tr><tr><td><code>primaryText</code></td><td><a href="#icontext">IconText</a></td><td>An Icon Text which can be shown as primary text to the thumbnail. This is rendered in the bottom left of the manga object on the view.</td></tr><tr><td><code>secondaryText</code></td><td><a href="#icontext">IconText</a></td><td>An Icon Text which can be shown as secondary text to the thumbnail. This is rendered on the bottom right of the manga object on the view.</td></tr></tbody></table><h2 id="pagedresults" tabindex="-1">PagedResults <a class="header-anchor" href="#pagedresults" aria-label="Permalink to &quot;PagedResults&quot;">​</a></h2><p>An object representing a &quot;page&quot; of requests. There is no limit to how many mangas fit in a page, that is up to the source to decide. These objects use the <a href="./metadata">metadata</a> field.</p><h3 id="required-fields-5" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields-5" aria-label="Permalink to &quot;Required Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td>results</td><td><a href="#mangatile">MangaTile</a> Array</td><td>The mangas that were found in the page.</td></tr><tr><td>metadata</td><td>any</td><td>The metadata to carry onto future calls of the function returning the object. Reference the <a href="./metadata">page on metadata</a> to learn more.</td></tr></tbody></table><h2 id="searchrequest" tabindex="-1">SearchRequest <a class="header-anchor" href="#searchrequest" aria-label="Permalink to &quot;SearchRequest&quot;">​</a></h2><p>An object representing the various properties in a search. The <code>title</code> parameter is the only parameter that is supported by the search request, and future versions of the API plan on changing the way advanced searches are done.</p><h3 id="optional-fields-4" tabindex="-1">Optional Fields <a class="header-anchor" href="#optional-fields-4" aria-label="Permalink to &quot;Optional Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>title</code></td><td>String</td><td>The text that the user is searching in the search box. <strong>Note: The title may be empty, such as if the user deletes the entire query. While some sources just treat an empty search as a queue to return all chapters, other sources might reject empty searches. Make sure to adequately deal with empty searches.</strong></td></tr><tr><td><code>author</code></td><td>String</td><td>The author that the user is searching works by.</td></tr><tr><td><code>artist</code></td><td>String</td><td>The artist that the user is searching works by.</td></tr><tr><td><code>status</code></td><td><a href="#mangastatus">MangaStatus</a></td><td>The status of the manga.</td></tr><tr><td><code>hStatus</code></td><td>Boolean</td><td>Whether or not to return only explicit results or to exclude all explicit results.</td></tr><tr><td><code>includeDemographic</code></td><td>String Array</td><td>The demographics to include in the search.</td></tr><tr><td><code>includeTheme</code></td><td>String Array</td><td>The themes to include in the search.</td></tr><tr><td><code>includeFormat</code></td><td>String Array</td><td>The formats to include in the search.</td></tr><tr><td><code>includeContent</code></td><td>String Array</td><td>The content to include in the search.</td></tr><tr><td><code>includeGenre</code></td><td>String Array</td><td>The genres to include in the search.</td></tr><tr><td><code>includeOperator</code></td><td>String Array</td><td>The operators to include in the search.</td></tr><tr><td><code>excludeDemographic</code></td><td>String Array</td><td>The demographics to exclude in the search.</td></tr><tr><td><code>excludeTheme</code></td><td>String Array</td><td>The themes to exclude in the search.</td></tr><tr><td><code>excludeFormat</code></td><td>String Array</td><td>The formats to exclude in the search.</td></tr><tr><td><code>excludeContent</code></td><td>String Array</td><td>The content to exclude in the search.</td></tr><tr><td><code>excludeGenre</code></td><td>String Array</td><td>The genres to exclude in the search.</td></tr><tr><td><code>excludeOperator</code></td><td>String Array</td><td>The operators to exclude in the search.</td></tr></tbody></table><h2 id="tag" tabindex="-1">Tag <a class="header-anchor" href="#tag" aria-label="Permalink to &quot;Tag&quot;">​</a></h2><p>A model representing an individual tag.</p><h3 id="required-fields-6" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields-6" aria-label="Permalink to &quot;Required Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>id</code></td><td>String</td><td>The internal identifier for the tag. Usually either the tag&#39;s name or a number that represents the tag.</td></tr><tr><td><code>label</code></td><td>String</td><td>The text for the tag that is shown to the user.</td></tr></tbody></table><h2 id="tagsection" tabindex="-1">TagSection <a class="header-anchor" href="#tagsection" aria-label="Permalink to &quot;TagSection&quot;">​</a></h2><p>A model representing a section of tags. Most sources have a section for official genres, and some sources might have a section of user-defined tags in addition to the official genres. Currently, only one tag section is displayed in a manga, although this might change in the future.</p><h3 id="required-fields-7" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields-7" aria-label="Permalink to &quot;Required Fields&quot;">​</a></h3><table><thead><tr><th>Name</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td><code>id</code></td><td>String</td><td>The ID representing this tag section.</td></tr><tr><td><code>label</code></td><td>String</td><td>The name of the Tag Section. The name is not currently shown to the user, but this may change in future versions of Paperback.</td></tr><tr><td><code>tags</code></td><td><a href="#tag">Tag</a> Array</td><td>An array of tags.</td></tr></tbody></table>',60),i=[o];function h(c,n,s,l,u,g){return d(),e("div",null,i)}const f=t(r,[["render",h]]);export{m as __pageData,f as default};
